import React from 'react';

const MedicalVacationPage = () => {
  return (
    <div>
      <h1>Medical Vacation</h1>
      <p>
        Experience world-class medical services combined with a relaxing vacation in Dubai. Our medical vacation
        packages cater to individuals seeking top-notch healthcare treatments in a luxurious setting, ensuring a
        seamless blend of wellness and leisure.
      </p>
    </div>
  );
};

export default MedicalVacationPage;
